import React from 'react'
import { connect } from 'react-redux'
import { setItemsToStore } from '../actions/itemActions'

class ListItems extends React.Component {
    render() {
        const { items, dispatchSetItemsToStore } = this.props
        return(
            <div>
                <ul>
                    {
                        items.map((item, i) => (
                            <li key={i}>
                                <p>{item.name}</p>
                                <p>{item.price}</p>
                                <p>{item.type}</p>
                            </li>
                        ))
                    }
                </ul>
            </div>
        )
    }
}

export const mapDispatchToProps = dispatch => ({
    dispatchSetItemsToStore: data => dispatch(setItemsToStore(data))
})

export default connect(null, mapDispatchToProps)(ListItems)
